import fetch from "node-fetch";

function Blog({ posts }) {
    return(
        <ul>
            {props.posts.map(post => {
                return(
                    <li key={post.id}>
                        <h2>{post.title}</h2>
                        <p>{post.body}</p>
                    </li>
                )
            })}
        </ul>
    )
}

export async function getStaticProps() {
    const res = await fetch("http://www.omdbapi.com/?apikey=d3353ed0&");
    const data = await res.json();
    const posts = await data.Search;
    return {
        props: {
            posts,
        }
    }
}

export default Blog;
